func testStudentToManyRemoveOpSubjects(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a Student
	var b, c, d, e Subject

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, studentDBTypes, false, strmangle.SetComplement(studentPrimaryKeyColumns, studentColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*Subject{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, subjectDBTypes, false, strmangle.SetComplement(subjectPrimaryKeyColumns, subjectColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	err = a.AddSubjects(ctx, tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.Subjects().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveSubjects(ctx, tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.Subjects().Count(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if len(b.R.Students) != 0 {
		t.Error("relationship was not removed properly from the slice")
	}
	if len(c.R.Students) != 0 {
		t.Error("relationship was not removed properly from the slice")
	}
	if d.R.Students[0] != &a {
		t.Error("relationship was not added properly to the foreign struct")
	}
	if e.R.Students[0] != &a {
		t.Error("relationship was not added properly to the foreign struct")
	}

	if len(a.R.Subjects) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.Subjects[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.Subjects[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

